#!/usr/bin/env python

import os
import sys
from io import BytesIO
import base64
from composite import PapirusComposite




# Running as root only needed for older Raspbians without /dev/gpiomem
if not (os.path.exists('/dev/gpiomem') and os.access('/dev/gpiomem', os.R_OK | os.W_OK)):
    user = os.getuid()
    if user != 0:
        print("Please run script as root")
        sys.exit()

def main():
    # create image from base64 string
    base64Img = '''''' 
    imgPaPiRus = BytesIO(base64.b64decode(base64Img));

    print("Writing to Papirus.......")
    textNImg = PapirusComposite(False)
    textNImg.AddText('I love my PaPiRus', 10, 0, 20)
    textNImg.AddImg(imgPaPiRus , 50, 50, (100,100))
    textNImg.WriteAll()
    print("Finished!")

if __name__ == '__main__':
    main()
